PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {
  <https://dblp.org/rec/conf/icapr/WangL05> dblp:authoredBy <https://dblp.org/pid/l/GrahamLeedham> .
  <https://dblp.org/rec/conf/icapr/WangL05> dblp:authoredBy <https://dblp.org/pid/w/LingyuWang2> .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {
  <https://dblp.org/rec/conf/recomb/SongL06> dblp:yearOfPublication 2007
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( DISTINCT ?pub ) AS ?totalPubs2016 ) WHERE {
  VALUES ?author {
    <https://dblp.org/pid/164/3309> <https://dblp.org/pid/184/6425> <https://dblp.org/pid/q/MeikangQiu>
  }
  ?pub dblp:authoredBy ?author ; dblp:yearOfPublication ?year .
  FILTER ( ?year = 2016 )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?wikidata WHERE {
  <https://dblp.org/pid/o/AJeffersonOffutt> dblp:wikidata ?wikidata
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?venue WHERE {
  <https://dblp.org/rec/journals/jlp/ShieberSP95> dblp:publishedIn ?venue
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?venue WHERE {
  VALUES ?author {
    <https://dblp.org/pid/19/2932-1> <https://dblp.org/pid/236/3060> <https://dblp.org/pid/40/4160> <https://dblp.org/pid/40/4731> <https://dblp.org/pid/55/2484-1>
  }
  ?other_pub dblp:authoredBy ?author .
  FILTER ( ?other_pub != <https://dblp.org/rec/conf/fgcn/ChenZXSS08> ) ?other_pub dblp:publishedIn ?venue .
}
ORDER BY ?venue

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?title ?venue ?year WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/63/10539> .
  OPTIONAL {
    ?pub dblp:title ?title
  }
  OPTIONAL {
    ?pub dblp:publishedIn ?venue
  }
  OPTIONAL {
    ?pub dblp:yearOfPublication ?year
  }
}
ORDER BY DESC ( ?year )

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?title ?venue ?year WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/64/490> ; dblp:publishedIn ?venue ; dblp:title ?title ; dblp:yearOfPublication ?year .
  FILTER ( ?venue = "VTC Spring" || ?venue = "CoRR" )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( DISTINCT ?pub ) AS ?numPapers ) WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/21/4802>
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?num1 ?num2 WHERE {
  <https://dblp.org/rec/journals/tcyb/MaB21> dblp:numberOfCreators ?num1 .
  <https://dblp.org/rec/conf/etfa/Missal0H07> dblp:numberOfCreators ?num2 .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?coauthor ?affiliation WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/286/6829> ; dblp:yearOfPublication ?year .
  FILTER ( ?year >= ( YEAR( NOW () ) - 2 ) ) ?pub dblp:authoredBy ?coauthor .
  FILTER ( ?coauthor != <https://dblp.org/pid/286/6829> ) OPTIONAL {
    ?coauthor dblp:primaryAffiliation ?affiliation
  }
}

