PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( AVG( ?countPerYear ) AS ?averagePubsPerYear ) WHERE {
  {
    SELECT ?year ( COUNT( DISTINCT ?pub ) AS ?countPerYear ) WHERE {
      ?pub dblp:authoredBy <https://dblp.org/pid/45/1135> .
      ?pub dblp:yearOfPublication ?year .
    }
    GROUP BY ?year
  }
}

